import React from "react";
import LessonItem from "./LessonItem";
const LessonOptionsList = ({ lessonOptions, onRegister }) => {
  return (
    <div>
      {lessonOptions ? (
        <ul>
          {lessonOptions.map((lessonOption) => (
            <div key={lessonOption.time_ability_id}>
              <LessonItem lessonOption={lessonOption} onRegister={onRegister} />
              <br />
            </div>
          ))}
        </ul>
      ) : (
        <p>No Lessons found for the given criteria.</p>
      )}
    </div>
  );
};
export default LessonOptionsList;
